import './App.css';
import React, {useState, useEffect} from "react";
import Photo from './components/Photo.js'

function App() {

  const [photos, setPhotos] = useState([])

  useEffect(() => {
    fetch('http://0.0.0.0:4000/')            
    .then(res => res.json())
    .then(data => setPhotos(data))
  }, [])


  const list_of_photos = photos.map((photo, i) => {
    return (<Photo key={i} photo={photo} position={i+1} />);
  })

  console.log(photos)

  return (
    <div className="App">
      <header className="App-header">
        <h1>My Flickr App</h1>
      </header>
      <article>
        <p>photos:</p>
        <p>{list_of_photos}</p>
      </article>
    </div>
  );
}

export default App;
